void skip_until(char *until)
{
  int i;
  int l = strlen(until);
  char chars[256];
  while(1)
    {
      while (1)
	{
	  chars[0] = yyinput();
	  if(chars[0] == EOF) 
	    {
	      fprintf(stderr, "Error, Unexpected End Of File\n") ;
	      exit(1);
	    }
	  if(chars[0] == until[0])break;
	}
      
      //printf("%c",chars[0]); 
      for(i=1;i<l;i++)
	{
	  chars[i] = yyinput();
	  if(chars[i] == EOF) 
	    {
	      fprintf(stderr, "Error, Unexpected End Of File\n") ;
	      exit(1);
	    }
	}
      chars[l] = '\0';
      if(!strcmp(chars,until))
	{
	  return;
	}
      for(i=1;i<l-1;i++)
	{
	  unput(chars[l-i]);
	}      
    }
}

